import { UserContext } from './UserContext';
import React, { useContext } from 'react'



function Home() {

  const [user, setUser] = useContext(UserContext);

  console.log(user);

  return (
    <div class="container">

      <div className="row">

          <div className="col-sm-2">League Info. Im typing to see where this column ends and the other begins</div> 
          <div className="col-sm-2">Team Info</div> 
          <div className="col-sm-10">Feed</div>    
      </div>
    </div>

  );
}

export default Home;
